import React from 'react'

class Cover extends React.Component {
    render() {
        return (
            <div className="warp-bg">
                <div className="bg">
                    <div className="warp-text">
                        <h1>ฐานข้อมูลผู้สูงอายุ</h1>
                        <button className="btn" >
                            <h6>เข้าสู่หน้าหลัก</h6>
                        </button>
                    </div>
                </div>
            </div>
        )
    }
}
export default Cover;
